import React from 'react';
import AppLayout from '../components/AppLayout';
import Head from 'next/head';
import PropTypes from 'prop-types';

/*pages에 있는 파일에 공통적으로 들어가는 것을
중복작업을 하지않기 위해 만든 파일
무조건 _app.js라는 파일명으로 만들어야 next에서 인식할수있다.
기본적으로 next에서 제공하지만 파일을 만들면 커스텀할 수있다.*/
const StarLive  = ({ Component }) => {
  return (
    <>
      <Head>
        <title>StarLive</title>
        <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.19.8/antd.css" />
        </Head>
        <AppLayout>
          <Component />
        </AppLayout>
    </>
  );
};
StarLive.propTypes = {
  Component: PropTypes.elementType, //여기서의 .node란 React에 들어갈 수있는 모든 것(태그, 문자열, 렌더링 될 수있는 모든 것)
};
export default StarLive;
